import React from "react";
import Navigation from "./navigation";
import Head from "next/head";

const Layout = (props) => {
  return (
    <div>
      <Head>
        <title>Nex.js - Project</title>
      </Head>
      <Navigation />
      {props.children}
    </div>
  );
};

export default Layout;
